import React from 'react';
import './header.css';
import Emblem from '../../../media/logo-img.png';
import {Container, Row, Col, Image} from 'react-bootstrap';

function header() {
    return (
        <>
        <header className = "header d-flex align-items-end justify-content-center" id = "home">
            <Container>
                <Row>
                    <Col className = "pt-5 d-flex justify-content-center">
                        <Image src = {Emblem} fluid></Image>
                    </Col>
                </Row>   
            </Container>  
        </header>
        <svg viewBox="0 0 500 150" preserveAspectRatio="none" className = "wave-svg">
            <path d="M0.00,92.27 C216.83,192.92 304.30,8.39 500.00,109.03 L500.00,0.00 L0.00,0.00 Z" className = "wave-path"></path>
             <path d="M0.00,92.27 C216.83,192.92 304.30,8.39 500.00,109.03 L500.00,0.00 L0.00,0.00 Z" className = "wave-path-2"></path>
        </svg>
        </>
    )
}

export default header
